      while (domainParts.length > 1 && !unprotectedDomain) {
          const partialDomain = domainParts.join('.');

          unprotectedDomain = featureList.filter(domain => domain.domain === partialDomain).length > 0;

          domainParts.shift();
      }

      return unprotectedDomain
